import React from "react";
import logo from "./Track-A-Book.png";
function Footer() {
  return (
    <footer>
      <hr />
      <p className="pull-right">
        <img src={logo} alt="logo" className="logo" /> Track-a-Book built using
        React.js
      </p>
    </footer>
  );
}

export default Footer;
